syntax "proto3";

package aws;

message AwsGlobalacceleratorAccelerator {
  dns_name = 1;
  enabled = 2;
  hosted_zone_id = 3;
  id = 4;
  ip_address_type = 5;
  ip_sets = 6;
  name = 7;
  tags = 8;
  message Attributes {
    flow_logs_enabled = 1;
    flow_logs_s3_bucket = 2;
    flow_logs_s3_prefix = 3;
  }
  attributes = 9;
}